    // }
    
   //localStorage.setItem('isLoggedOut','null');
     
    render() {
        return (
           
           <div>
                 <p>Logged out successfully</p>
                <NavLink to='/login' className="navlink">click here to re-login </NavLink>
            </div>
        );
    }
}

export default Logout;
